import React, { Component } from "react";
import ListOfPlants from "../ListOfPlants/ListOfPlants";
import axios from "axios";

export default class Home extends Component {
  state = {
    plantInfo: [],
  };
  componentDidMount() {
    console.log("Component DID MOUNT!");
    axios.get("https://localhost:5001/api/TodoItems").then((res) =>
      this.setState({
        plantInfo: res.data,
      })
    );
  }
  render() {
    return (
      <div>
        Home
        {/*STATUS BAR COMPONENT*/}
        {/* Map over the stuff*/}
        {this.state.plantInfo.map((plant) => (
          <ListOfPlants plant={plant} />
        ))}
      </div>
    );
  }
}
